vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2878:"《我的燃情岁月》讲述了那个逝去的年代，一批绚丽夺目的青春女兵参加野战医疗卫生队，用激情人生和残酷青春抒写生存和死亡的故事……&nbsp;　　故事通过一个19岁像花一样绚烂的女孩方捷新兵入伍展开，在那颠荡起伏的嘎斯车上以一首热情洋溢的革命歌曲作为引申，穿越时间的厚茧，还原到了那个充满理想充满热情的年代……&nbsp;　　通过一个个小人物的生和死那浓缩的片段，讲述了生和死的意义，展现生命的尊严、灵魂的重量、活着的美丽和人性的光芒，力图从死亡中拯救出一些东西；他们有的是优秀的医生，有的是美丽的女兵，有的是天真的孩子……也许，另有比生命着本身更值得他们坚守的，比如理想，比如爱情，比如责任，比如希望……&nbsp;　　本剧在故事的背后阐述了生是偶然的，死是必然的这一自然现象，而更多的是探讨活着的人应该多去珍惜美好的生活，当死的时候，希望是一种解脱，只希望不后悔，爱过，追求过，付出过，得到过，失去过，未尝不是一种领悟……&nbsp;　　在记忆里，很多消失的人和事，本来已‘入土为安’，却被记忆顽强地保留着，然后在某一时刻重生，或者说复活&nbsp;　　生，是一种态度。死，是一种姿态。生与死，构成了人生的始末……&nbsp;　　它是电视剧版《阳光灿烂的日子》&nbsp;　　经过两年的筹备，剧本创作四易其人，虽然没有商业悬疑和情爱，无法讨巧观众，但投拍方称，“就是为了打造出一部电视版的《阳光灿烂的日子》，要让这个剧“每个毛孔都带着那个时代的质感”。 　　《我的燃情岁月》展现的是一代人的青春，虽然有着特定时代的淡淡痕迹，更多的却是所有走过青春的人都能体会到的灼热温度。导演姜凯阳说，在他的记忆里，那个年代的天很蓝，水很清，树很绿，人的眼睛很亮……对那个逝去年代的深深的怀恋是他喜欢这个剧的原因。两个月的拍摄，大家都在努力在时间隧道中逆行，寻找着那个年代的感觉。&nbsp;　　它是女兵版《士兵突击》&nbsp;　　《我的燃情岁月》是以女主角方捷(《我的青春谁作主》中李霹雳的扮演者林园饰演)回忆的方式，讲述的一部女兵成长史，该角色和《士兵突击》中的许三多一样，都是一个贯穿全剧的人物，“女版许三多”的称谓由此而来。“如果从励志的角度说，倒也可以这么评价。”柳叶刀说，方捷和许三多的性格都很执着，“有时，过度执着会容易让人受不了，许三多是这样，方捷也是。”我的燃情岁月的演职员 · · · · · · ( 全部 15 )";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1280:"第01集$https://www.qzamfz.com/20190829/LQJrHNtz/index.m3u8#第02集$https://www.qzamfz.com/20190829/36OajYvX/index.m3u8#第03集$https://www.qzamfz.com/20190829/8ulATx2v/index.m3u8#第04集$https://www.qzamfz.com/20190829/e9zIWpgt/index.m3u8#第05集$https://www.qzamfz.com/20190829/bdF3rNZh/index.m3u8#第06集$https://www.qzamfz.com/20190829/2BTiaKUG/index.m3u8#第07集$https://www.qzamfz.com/20190829/aDpGSqNJ/index.m3u8#第08集$https://www.qzamfz.com/20190829/SMgoVi64/index.m3u8#第09集$https://www.qzamfz.com/20190829/f4vVHjwA/index.m3u8#第10集$https://www.qzamfz.com/20190829/1P4prK6H/index.m3u8#第11集$https://www.qzamfz.com/20190829/YqEbsTy1/index.m3u8#第12集$https://www.qzamfz.com/20190829/xGoBS9aQ/index.m3u8#第13集$https://www.qzamfz.com/20190829/9gfYSjAh/index.m3u8#第14集$https://