1566886015;s:12:"vod_time_add";i:1566886015;s:13:"vod_time_hits";i:1567073966;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2950:"Akkanee(guy)是一位便衣jing察，他一直在寻找一位叫kim的人，kim是他的同胞弟弟，在几年前离家出走Padet(tar)是一位刑jing队长，也是Akkanee(guy)的好朋友，他发现了kim的尸体，被人枪击后抛弃在乡村荒野里。&nbsp;　　kim 为一位叫Mr.Neab Jitroong(Teerapong Liewrakwong)贩du商人工作。Mr.Neab Jitroong因kim暗恋自己的女儿NootkaanDaa(grand)感到不满，但是他又不想激怒自己的女儿。Mr.Neab 要求kim拿着20亿泰铢与du贩Baang Borapet(Anuwat Niwaadwong)交易，Baang Borapet是“Borapet field”的拥有者，du品制造商。kim偷了很多钱，在赌bo中又输了5亿泰铢，所以他擅自更改了交易内容，这被Baang Borapet知道后，派Wong (Pongsiree Banluewong)追杀kim，将尸体抛到“Samankong”，Sua老爷爷(Sorapong Chaadree)是“Samankong”拥有者，与Mr.Neab 相互为敌。Sua老爷爷的外甥女Saman(vill)无意中发现了kim的尸体。&nbsp;　　Akkanee(guy)假扮成工人来到 Samankong，查找杀死kim的凶手。Saman(vill)惊讶Akkanee(guy)与自己看到的死者的面容长的如此相似，但是 Akkanee(guy)说他从没见过kim并不认识他。Saman(vill)质疑Akkanee(guy)的身份，想找出破绽，但 Akkanee(guy)总有办法逃避，这让Saman(vill)感到不安，并开始讨厌他。可Akkanee(guy)十分欣赏Saman(vill) 的勇敢。Akkanee(guy)在“Baang”找到了新的工作，Saman(vill)非常生气，觉得他们将成为敌人，不愿再和 Akkanee(guy)做朋友。&nbsp;　　Baanchuen (Aerin)是Baang的女儿，对Akkanee(guy)一见钟情，这惹怒了Wong (Pongsiri)，因为Wong (Pongsiri)是Baanchuen (Aerin)的追求者之一。&nbsp;　　Padet(tar) 因调查案件而接近NootkaanDaa(grand)，这使他们的关系越来越好。Mr. Neab想成为政客，他引诱政客的儿子Sorawit(Chayapon Tueng sawangron)加入du品交易圈。同时希望Sorawit介入并阻拦Padet(tar)与NootkaanDaa(grand)的交往。&nbsp;　　Akkanee(guy) 接受了Baanchuen (Aerin)的追求，以此取得Baang的信任。一天，Baang安排Akkanee(guy)带着du品与Sorawit交易，Sorawit与他谈 判，让他直接与Baang进行交易，而不是通过第三人，Akkanee(guy)同意了这个条件。Akkanee(guy)与Padet(tar)碰面， 见到了Padet的姐姐PaDaa (Daarin Boonyasak)，PaDaa在Akkanee(guy)的手机里见到了Saman(vill)的照片，认为Saman(vill)或许就是她丈夫带 走的女儿，Akkanee(guy)答应会找出真相。&nbsp;　　Akkanee(guy)约了Sorawit与Baang见面，完成du品交易，而 Mr. Neab出来阻扰，并说出了他是Baang的幕后老板。命令Baang杀了Sorawit，和解决kim一样。由此，Akkanee(guy)知道了真 相。知晓真相后的Akkanee(guy)会实施什么计划呢？Padet(tar)又会怎么配合？Saman(vill)和Akkanee(guy)感情 会怎样发展，而Padet(tar)与NootkaanDaa(grand)之前会有怎样的变数？";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:121:"第01集$https://www.qzamfz.com/20190826/xIiQWYTV/index.m3u8#第02集$https://www.qzamfz.com/20190826/IMHkJZfi/index.m3u8";s:13:"vod_down_from";s:0:"";s:15:"vod_down_server";s:0:"";s:13:"vod_down_note";s:0:"";s:12:"vod_down_url";s:0:"";s:4:"type";a:18:{s:7:"type_id";i:21;s:9:"type_name";s:9:"其他剧";s:7:"type_en";s:6:"qitaju";s:9:"type_sort";i:5;s:8:"type_mid";i:1;s:8:"type_pid";i:2;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:0:"";s:8:"type_des";s:0:"";s:10:"type_title";s:0:"";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:0:"";s:4:"area";s:0:"";s:4:"lang";s:0:"";s:4:"year";s:0:"";s:4:"star";s:0:"";s:8:"director";s:0:"";s:5:"state";s:0:"";s:7:"version";s:0:"";}s:6:"type_1";a:18:{s:7:"type_id";i:2;s:9:"type_name";s:9:"连续剧";s:7:"type_en";s:8:"lianxuju";s:9:"type_sort";i:2;s:8:"type_mid";i:1;s:8:"type_pid";i:0;s:11:"type_status";i:1;s:8:"type_tpl";s:9:"type.html";s:13:"type_tpl_list";s:9:"show.html";s:15:"type_tpl_detail";s:11:"detail.html";s:13:"type_tpl_play";s:9:"play.html";s:13:"type_tpl_down";s:9:"down.html";s:8:"type_key";s:82:"电视剧,最新电视剧,好看的电视剧,热播电视剧,电视剧在线观看";s:8:"type_des";s:214:"为您提供2018新电视剧排行榜，韩国电视剧、泰国电视剧、香港TVB全新电视剧排行榜、好看的电视剧等热播电视剧排行榜，并提供免费高清电视剧下载及在线观看。";s:10:"type_title";s:9:"电视剧";s:10:"type_union";s:0:"";s:11:"type_extend";a:8:{s:5:"class";s:117:"古装,战争,青春偶像,喜剧,家庭,犯罪,动作,奇幻,剧情,历史,经典,乡村,情景,商战,网剧,其他";s:4:"area";s:72:"内地,韩国,香港,台湾,日本,美国,泰国,英国,新加坡,其他";s:4:"lang";s:51:"国语,英语,粤语,闽南语,韩语,日语,其它";s:4:"year";s:69:"2018,2017,2016,2015,2014,2013,2012,2011,2010,2009,2008,2006,2005,2004";s:4:"star";s:205:"王宝强,胡歌,霍建华,赵丽颖,刘涛,刘诗诗,陈伟霆,吴奇隆,陆毅,唐