;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:2130:"日军侵华期间，疯狂掠夺位于长城脚下的金牛坨金矿资源，长达七年之久在一九四五年投降前，驻扎在金矿的日军，将八百块金砖藏于秘密金库，并将二百多中国劳工屠杀在巷道里，烧毁了金牛坨村庄，这一切都是为了杀人灭口，然而在死里逃生中，唯有田有父亲活了下来，告密者向组织报告了田大山叛党保命的血案。被开除党籍的田大山，面前摆着两条路，一是背着汉奸叛徒之名就地伏法，二是找到日军藏于秘密金库的八百块金砖证明自已的清白，田大山为了洗清自己的冤情，钻进大山肚子，寻找日本人藏在山里的金库，结果迷失在蜘蛛网似的废巷道里，活不见人，死不见尸。田有为了寻找父亲并证明自己父亲是清白的，又一次被坏人告密在监狱一蹲就是七年……他为父亲洗冤信念一直象火一样在胸中燃烧，田有誓言，要用自己的一生为父亲证明清白，田有心中明白，父亲是个顶天立地的爷们，一个优秀的老******员…… 在田有雇来的淘金工中，有来金牛坨村寻找心上人的，却被田有二女儿田凤芹一见钟情的神秘男子；有一肚子坏水、随时可能出卖朋友的猥琐小人；也有窥视金矿已久的在逃杀人犯；还有先来骗婚而后又爱上大哑巴的“放鹰女”。一边是各怀心思的淘金工，一边是处处找茬儿设阻的大洋驴，外加废巷道里不时有神秘生物的骚扰，田有被拽进经济和精神的无尽煎熬。 田有却屡屡因祸得福，不仅采到淘金人千载难逢的纯金条，还通过一次次打通废巷道，不断发现失踪在大山里的父亲留下的蛛丝马迹，以及当年日本鬼子设下的一道道陷阱。 田有在废巷道里不仅找到已经变成白毛人的父亲，还发现了当年日本鬼子藏在金库里的八百块金砖，为父亲洗清了几十年的冤情。周道新带着当年沾满鲜血的日本兵后代回到这里认罪，跪在埋有中国几百劳工尸骨的大山和长城面前……&nbsp;";s:13:"vod_play_from";s:8:"subom3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1829:"第01集$https://www.qzamfz.com/20190818/tvqo2Alj/index.m3u8#第02集$https://www.qzamfz.com/20190818/XHmL1h5f/index.m3u8#第03集$https://www.qzamfz.com/20190818/Q8tJI6aF/index.m3u8#第04集$https://www.qzamfz.com/20190818/5zuDRAY0/index.m3u8#第05集$https://www.qzamfz.com/20190818/WvhlU0S5/index.m3u8#第06集$https://www.qzamfz.com/20190818/90CNnc6A/index.m3u8#第07集$https://www.qzamfz.com/20190818/Xxc5jKyH/index.m3u8#第08集$https://www.qzamfz.com/20190818/bQGvjl2q/index.m3u8#第09集$https://www.qzamfz.com/20190818/Q5eDq23v/index.m3u8#第10集$https://www.qzamfz.com/20190818/C2L86I4Z/index.m3u8#第11集$https://www.qzamfz.com/20190818/rw3y4oE7/index.m3u8#第12集$https://www.qzamfz.com/20190818/5qS9XbAG/index.m3u8#第13集$https://www.qzamfz.com/20190818/aXSpEowi/index.m3u8#第14集$https://www.qzamfz.com/20190818/9bhoCiIz/index.m3u8#第15集$http