;s:0:"";s:12:"vod_tpl_play";s:0:"";s:12:"vod_tpl_down";s:0:"";s:9:"vod_isend";i:1;s:8:"vod_lock";i:0;s:9:"vod_level";i:0;s:13:"vod_copyright";i:0;s:10:"vod_points";i:0;s:15:"vod_points_play";i:0;s:15:"vod_points_down";i:0;s:8:"vod_hits";i:852;s:12:"vod_hits_day";i:26;s:13:"vod_hits_week";i:478;s:14:"vod_hits_month";i:271;s:12:"vod_duration";s:0:"";s:6:"vod_up";i:626;s:8:"vod_down";i:143;s:9:"vod_score";s:3:"5.0";s:13:"vod_score_all";i:4600;s:13:"vod_score_num";i:920;s:8:"vod_time";i:1565498914;s:12:"vod_time_add";i:1565498914;s:13:"vod_time_hits";i:0;s:13:"vod_time_make";i:0;s:10:"vod_trysee";i:0;s:13:"vod_douban_id";i:0;s:16:"vod_douban_score";s:3:"0.0";s:9:"vod_reurl";s:0:"";s:11:"vod_rel_vod";s:0:"";s:11:"vod_rel_art";s:0:"";s:7:"vod_pwd";s:0:"";s:11:"vod_pwd_url";s:0:"";s:12:"vod_pwd_play";s:0:"";s:16:"vod_pwd_play_url";s:0:"";s:12:"vod_pwd_down";s:0:"";s:16:"vod_pwd_down_url";s:0:"";s:11:"vod_content";s:4054:"继将好兄弟Wilson的爱车开进旧情人Cuddy的客厅后，备受伤害的House终于在等待假释的看守所内找到了新的刺激当然，编剧没有忘记为House安插新的小朋友进行调教：这次被House征服的是具有一副混血面孔的美丽女医生Adams。 House在新剧集里再次展现了惊人的天赋。过人的观察力、大胆的推理、剑走偏锋的行事风格和神乎其技的查体功底一览无遗。曾在Hopkins训练过的高材生Adams医生态度也从开始的倨傲转向惊奇，并最终成为House式行动的追随者。 本集的病例依旧稀有。与往常不同，House这次并没有充沛的医疗资源可加利用，诊断完全依靠最原始的手段。一名年轻男子在狱中相继出现了关节痛、发热、皮疹等症状，Adams起初认为是淋病，但House以更有说服力的红斑狼疮推翻了Adams。不过患者的表现远不止这么简单，该男子被烟草熏黄的手指和接下来发生的骨折使House转向晚期肺癌的诊断。此时的House表现出神乎其技的听诊技能：在没有听诊器的情况下House准确地查出患者肺部存在阴影。有经验的临床专家通过轻拍即可了解患者两肺的情况，更有奇人可仅凭听诊估算患者心脏的EF值（射血分数，通常需要心脏超声的帮助来进行模拟计算）。House的天赋大概集中了全世界最有经验医生的传奇，当然，对于绝大多数中庸之资的凡人来说，追求这种境界其实远不如读好一张胸片或安排一次可靠的超声来的保险。House的神奇并没有帮到这名患者，胸片显示该男子的肺部阴影并非癌症。患者极易流血不止的表现也不符合肺癌晚期常有的高凝状态，病情更趋复杂了。除此之外，患者又发生了过敏性休克，幸好有医生在场，简易情形下的气管切开术挽救了这个年轻人的生命。现在，所有的临床表现终于齐全了：凝血功能障碍、皮疹、骨质疏松、过敏，答案会是什么呢？即将离开的House想到了肥大细胞增多症（Mastocytosis）。这种血液系统疾病能够侵犯全身多个系统，并常常表现为发作性过敏。肥大细胞释放组胺等炎症介质，使得患者产生荨麻疹、喉头水肿甚至窒息。不过，潮红、低血压等类过敏征象并非仅限于肥大细胞增多症，在做出此项诊断之前，还需要谨慎考虑脓毒症、类癌综合征、神经内分泌肿瘤如VIP瘤或嗜铬细胞瘤、甲状腺髓样癌等疾患。而这些疾病的排除需要细致的全身检查和多种实验室检查。House的编剧在此简化了细节，选择利用阿司匹林来进行简易诊断。阿司匹林（乙酰水杨酸）是一种环氧化酶抑制剂，可抑制前列腺素（PG）的生物合成，同时又可促进产生过敏介质白三烯（LT），增强肥大细胞诱发的过敏反应。因此，当已有过敏潜质的患者服用阿司匹林后，很可能当场诱发过敏性休克。这将有助于排除上述其他原因造成的类似表现。晚餐上的纸条证明，House又一次猜中了结局。 当然，本剧的亮点远非这个case本身。House在深陷江湖危机之时还不忘为室友拯救中毒的宠物蟋蟀，所用的手段仍然令人耳目一新。而这个成功的解救也为后来House乱中解围埋下了伏笔。 House的天赋来自编剧。能够写出各种各样奇怪病例的House编剧，医学功底也相当了得。凑巧的是，在《新英格兰医学杂志》上，就刊有一篇关于肥大细胞增多症的病例报告。在这份报告中，患者在使用阿司匹林后过敏症状加重，麻省总医院（MGH）的现实版House们终于经过周密的诊治手段确认了病情。当然，在鉴别分析及治疗细节上，专业的医学期刊所体现的又是另一种美感了。本集House的故事原型，是否脱胎于此呢？而如此专业的态度，大概也正是国内编剧所无法企及的高度了吧。";s:13:"vod_play_from";s:9:"zuidam3u8";s:15:"vod_play_server";s:2:"no";s:13:"vod_play_note";s:0:"";s:12:"vod_play_url";s:1747:"第01集$http://yanzishan.shuhu-zuida.com/20190811/7334_839f8bcb/index.m3u8#第02集$http://yanzishan.shuhu-zuida.com/20190811/7333_244e4298/index.m3u8#第03集$http://yanzishan.shuhu-zuida.com/20190811/7332_91b10fe5/index.m3u8#第04集$http://yanzishan.shuhu-zuida.com/20190811/7331_dea4db2b/index.m3u8#第05集$http://yanzishan.shuhu-zuida.com/20190811/7330_233f533b/index.m3u8#第06集$http://yanzishan.shuhu-zuida.com/20190811/7329_60bea05c/index.m3u8#第07集$http://yanzishan.shuhu-zuida.com/20190811/7328_1997087c/index.m3u8#第08集$http://yanzishan.shuhu-zuida.com/20190811/7327_fd284c93/index.m3u8#第09集$http://yanzishan.shuhu-zuida.com/20190811/7326_91321020/index.m3u8#第10集$http://yanzishan.shuhu-zuida.com/20190811/7325_f97007d8/index.m3u8#第11集$http://yanzishan.shuhu-zuida.com/20190811/7324_f75fcaaa/index.m3u8#第12集$http://yanzishan.shuhu-zuida.com/20190811/7323_227d53f8/index.m3u8#第13集$http://yanzishan.shuhu-zuida.com/20190811/7322_53ef558e/index.m3u8#第14集$http://yanzishan.shuhu-zuida.com/20190811/7321_6aef0657/index.m3u8#第15集$http://yanzishan.shuhu-zuida.com/20190811/7320_358a0c84/index.m3u8#第16集$http://yanzishan.shuhu-zuida.com/20190811/7319_7f738e4f/index.m3u8#第17集$http://yanzishan.shuhu-zuida.com/20190811/7318_fda58829/index.m3u8#第18集$http://yanzishan.shuhu-zuida.com/20190811/7317_83df2f18/index.m3u8#第19集$http://yanzishan.shuhu-zuida.com/20190811/7316_9e61d1e8/index.m3u8#第20集$http://yanzishan.shuhu-zuida.com/20190811/7315_83081d34/index.m3u8#第21集$http://yanzishan.shuhu-zuida.com